import React from "react";
import "./Navbar.css";
import {link} from "reac"

function Navbar() {
  return (
    <div class="topnav">
    <link></link>
      <a class="active" href="#home">
        Home
      </a>
      <a href="#news">News</a>
      <a href="#contact">Contact</a>
      <a href="#about">About</a>
    </div>
  );
}

export default Navbar;
